        private WideFlangeProfileServer()
        {
            // Read the data.
            using(var reader = new StringReader(_data))
            {
                var lineCount = -1;
                while(true)
                {
                    lineCount++;
                    var line  = reader.ReadLine();

                    if(lineCount == 0)
                    {
                        continue;
                    }

                    if(line != null)
                    {
                        var values = line.Split(',');
                        try{
                            var profile = new WideFlangeProfile(values[0]){
                                A = double.Parse(values[1]),
                                d = double.Parse(values[2]) * InchesToMeters,
                                tw = double.Parse(values[3]) * InchesToMeters,
                                bf = double.Parse(values[4]) * InchesToMeters,
                                tf = double.Parse(values[5]) * InchesToMeters,
                                T = values[6],
                                k = double.Parse(values[7]),
                                k1 = double.Parse(values[8]),
                                gage = values[9],
                                rt = double.Parse(values[10]),
                                dAf = double.Parse(values[11]),
                                Ix = double.Parse(values[12]),
                                Sx = double.Parse(values[13]),
                                rx = double.Parse(values[14]),
                                Iy = double.Parse(values[15]),
                                Sy = double.Parse(values[16]),
                                ry = double.Parse(values[17]),
                                Zx = double.Parse(values[18]),
                                Zy = double.Parse(values[19]),
                                J = double.Parse(values[20]),
                                Cw = double.Parse(values[21]),
                                Wno = double.Parse(values[22]),
                                Sw = double.Parse(values[23]),
                                Qf = double.Parse(values[24]),
                                Qw = double.Parse(values[25])
                            };
                            _profiles.Add(values[0], profile);
                        }
                        catch
                        {
                            Console.WriteLine($"The section, {values[0]}, could not be loaded.");
                        }
                    }
                    else
                    {
                        break;
                    }
                }
            }
        }

        /// <summary>
        /// The WideFlangeProfileServer singleton.
        /// </summary>
        public static WideFlangeProfileServer Instance
        {
            get
            {
                if (instance==null)
                {
                    instance = new WideFlangeProfileServer();
                }
                return instance;
            }
        }

    }
